def send_complaint(user_id, contact, email, proxy, text, violation_link, num_complaints):
    headers = {'User-Agent': random.choice(user_agents)}
    payload = {
        'text': text.format(user_id=user_id, email=email, contact=contact, violation_link=violation_link),
        'contact': contact
    }
    success_count = 0
    for i in range(num_complaints):
        try:
            response = requests.post(url, data=payload, headers=headers, proxies=proxy, timeout=15)
            response.raise_for_status()
            success_count += 1
            print(f"Жалоба ({i+1}) отправлена")
        except requests.RequestException as e:
            print(f"Ошибка при отправке жалобы ({i+1}) для user ID: {user_id} using proxy: {proxy}. Error: {e}")
    return success_count

