def send_email_complaints(complaint_type, subtype, user_id, violation_link, num_complaints):
    senders = {
        'kseniya.pavlova.9898@mail.ru': 'GRVDAjqvvx9xz00L2wUx',
        'annakrasnova.1994@mail.ru': 'jUFMXba6wLFcuQBkqht2',
    }

    receivers = [
        "sms@telegram.org", "dmca@telegram.org", "abuse@telegram.org", "sticker@telegram.org", "support@telegram.org", "stopca@telegram.org", "security@telegram.org"
    ]

    complaint_templates = {
        1: {
            1: ["Этот человек {user_id} откровенно запугивает меня, обещая опубликовать мои данные! Необходимо его остановить! Ссылка на сообщение с угрозой: {violation_link}"],
            2: ["Пользователь {user_id} распространяет порнографические материалы. Прошу заблокировать его аккаунт за нарушение правил платформы. Ссылка на материалы: {violation_link}"],
            3: ["Пользователь {user_id} распространяет религиозную нетерпимость и оскорбляет мои религиозные чувства. Ссылка на сообщение: {violation_link}"],
            4: ["Пользователь {user_id} провоцирует конфликты и оскорбляет меня. Прошу принять меры. Ссылка на сообщение: {violation_link}"]
        },
        2: {
            1: ["Канал {user_id} распространяет материалы, связанные с жестоким обращением с животными. Прошу принять меры. Ссылка на материалы: {violation_link}"],
            2: ["Канал {user_id} сливает личные данные пользователей. Прошу заблокировать канал. Ссылка на материалы: {violation_link}"],
            3: ["Канал {user_id} распространяет порнографические материалы. Прошу заблокировать канал. Ссылка на материалы: {violation_link}"]
        }
    }

    def send_email(receiver, sender_email, sender_password, subject, body):
        try:
            msg = MIMEMultipart()
            msg['From'] = sender_email
            msg['To'] = receiver
            msg['Subject'] = subject
            msg.attach(MIMEText(body, 'plain'))

            server = smtplib.SMTP('smtp.mail.ru', 587)
            server.starttls()
            server.login(sender_email, sender_password)
            server.sendmail(sender_email, receiver, msg.as_string())
            server.quit()
            return True
        except Exception as e:
            print(f"Ошибка при отправке email: {e}")
            return False

    for _ in range(num_complaints):
        sender_email = random.choice(list(senders.keys()))
        sender_password = senders[sender_email]
        receiver = random.choice(receivers)
        complaint_template = random.choice(complaint_templates[complaint_type][subtype])
        complaint_body = complaint_template.format(user_id=user_id, violation_link=violation_link)
        subject = f"Срочно к прочтению!!!"
        send_email(receiver, sender_email, sender_password, subject, complaint_body)

